    var procEntry32: PROCESSENTRY32 = new(PROCESSENTRY32)[]
    result = 0

    var procNameArray: array[0..259,char]
    for i in 0..(procName.len - 1):
        procNameArray[i] = procName[i]
    
    var hSnapshot = CreateToolhelp32Snapshot(TH32CS_SNAPPROCESS, 0)
    if INVALID_HANDLE_VALUE == hSnapshot:
        return 0

    procEntry32.dwSize = DWORD(sizeof(PROCESSENTRY32))

    if not bool(Process32First(hSnapshot, &procEntry32)):
        CloseHandle(hSnapshot)
        return 0

    while bool(Process32Next(hSnapshot, &procEntry32)):
        # Build a nim string, this is probably more expensive then it needs to be but oh well I dropped out of CS lol
        var i = 0
        var tmpStr = ""
        while true:
            if char(procEntry32.szExeFile[i]) == nil: break
            tmpStr = tmpStr & $char(procEntry32.szExeFile[i])
            i += 1

        # String compare
        if procName.cmpIgnoreCase(tmpStr) == 0:
            result = procEntry32.th32ProcessID
            return
    echo("Process wasn't found")
    return 0

